(2, 'Leave Request for Cover Up', 'Leave Request for Cover- Up', '<table align="center" class="row float-center" style="Margin:0 auto;border-collapse:collapse;border-spacing:0;float:none;margin:0 auto;padding:0;position:relative;text-align:center;vertical-align:top;width:100%"><tbody><tr style="padding:0;text-align:left;vertical-align:top">\n                        <th class="small-12 large-12 columns first last" style="Margin:0 auto;color:#0a0a0a;font-family:Helvetica,Arial,sans-serif;font-size:16px;font-weight:400;line-height:1.3;margin:0 auto;padding:0;padding-bottom:0;padding-left:16px;padding-right:16px;text-align:left;width:564px"><table style="border-collapse:collapse;border-spacing:0;padding:0;text-align:left;vertical-align:top;width:100%"><tbody><tr style="padding:0;text-align:left;vertical-align:top"><th style="Margin:0;color:#0a0a0a;font-family:Helvetica,Arial,sans-serif;font-size:16px;font-weight:400;line-height:1.3;margin:0;padding:0;text-align:left">\n                            <h5 class="u-name" style="Margin:0;Margin-bottom:10px;color:#4e4f4b;font-family:Helvetica,Arial,sans-serif;font-size:20px;font-weight:400;line-height:1.3;margin:0;margin-bottom:10px;padding:0;text-align:left;word-wrap:normal">Hi [coverup_name],</h5>\n                            <p class="MsoNormal" style="margin-bottom:7.5pt;line-height:normal"><span style="font-size:10.0pt;font-family:&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:\n&quot;Times New Roman&quot;;color:#666666;mso-bidi-language:SI-LK">[requester_name] has\nnominated you as the cover-up for the [leave_type]. [he_she]'' has requested\nfrom </span><span style="font-size:10.0pt;font-family:&quot;Helvetica&quot;,sans-serif;\ncolor:#666666">[leave_start] </span><span style="font-size:10.0pt;font-family:\n&quot;Helvetica&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#666666;\nmso-bidi-language:SI-LK">to </span><span style="font-size:10.0pt;font-family:\n&quot;Helvetica&quot;,sans-s