ont-weight:400;line-height:1.3;margin:0 auto;padding:0;padding-bottom:0;padding-left:16px;padding-right:16px;text-align:left;width:564px">\r\n            <table style="border-collapse:collapse;border-spacing:0;padding:0;text-align:left;vertical-align:top;width:100%">\r\n                <tbody><tr style="padding:0;text-align:left;vertical-align:top">\r\n                    <th style="Margin:0;color:#0a0a0a;font-family:Helvetica,Arial,sans-serif;font-size:16px;font-weight:400;line-height:1.3;margin:0;padding:0;text-align:left">\r\n                        <p style="margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:0in"><span style="font-size:10.0pt;font-family:&quot;Helvetica&quot;,sans-serif;color:#666666">This\r\nis auto generated Email if you need more clarification please contact HR\r\nDepartment.<o:p></o:p></span></p><p style="color: rgb(102, 102, 102); font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 1.3; margin-bottom: 10px;">\r\n\r\n<span style="font-size: 10pt; line-height: 107%; font-family: Helvetica, sans-serif;">Thank\r\nyou.</span><br></p>\r\n                    </th>\r\n                    <th class="expander" style="Margin:0;color:#0a0a0a;font-family:Helvetica,Arial,sans-serif;font-size:16px;font-weight:400;line-height:1.3;margin:0;padding:0!important;text-align:left;visibility:hidden;width:0"></th>\r\n                </tr>\r\n            </tbody></table>\r\n        </th>\r\n    </tr>\r\n    </tbody>\r\n</table>\r\n<!--Content close-->', 1, 1, 'interview_scheduling', NULL, NULL);
