(20, 'Maternity Leave Request for your Approval', 'Maternity Leave Request for your Approval', '<table align="center" class="row float-center" style="Margin:0 auto;border-collapse:collapse;border-spacing:0;float:none;margin:0 auto;padding:0;position:relative;text-align:center;vertical-align:top;width:100%">\r\n                    <tbody>\r\n                    <tr style="padding:0;text-align:left;vertical-align:top">\r\n                        <th class="small-12 large-12 columns first last" style="Margin:0 auto;color:#0a0a0a;font-family:Helvetica,Arial,sans-serif;font-size:16px;font-weight:400;line-height:1.3;margin:0 auto;padding:0;padding-bottom:0;padding-left:16px;padding-right:16px;text-align:left;width:564px">\r\n                            <table style="border-collapse:collapse;border-spacing:0;padding:0;text-align:left;vertical-align:top;width:100%">\r\n                                <tbody><tr style="padding:0;text-align:left;vertical-align:top">\r\n                                    <th style="Margin:0;color:#0a0a0a;font-family:Helvetica,Arial,sans-serif;font-size:16px;font-weight:400;line-height:1.3;margin:0;padding:0;text-align:left">\r\n                                        <h5 class="u-name" style="Margin:0;Margin-bottom:10px;color:#4e4f4b;font-family:Helvetica,Arial,sans-serif;font-size:20px;font-weight:400;line-height:1.3;margin:0;margin-bottom:10px;padding:0;text-align:left;word-wrap:normal">\r\n                                            Hi [approver_name],</h5>\r\n                                        <p style="margin: 0in 0in 7.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:10.0pt;font-family:&quot;Helvetica&quot;,sans-serif;\r\ncolor:#666666">[requester_name] has applied leave from [leave_start] to\r\n[leave_end].  Please\r\nclick below and convey your decision.<o