INSERT INTO `infomaster_news` (`id`, `news_heading`, `news_body`, `added_by`, `updated_by`, `added_date`, `updated_date`, `active`) VALUES
(45, 'HRMS Solutions Recognized by Epicor as Gold Partner in Annual Partner Program Awards', 'We are delighted to once again be recognized by Epicor as a Gold Partner. Our Epicor HCM Practice continues to provide exceptional value to helping our customers solve their human capital challenges by leveraging Epicor HCM', '', '', '2017-01-18 16:46:53', '0000-00-00 00:00:00', 'Active'),
(46, 'HRMS Solutions One of the 50 Best Small Workplaces in the US', 'According to Fortune & Great Best Place to Workwinning a spot on the list indicates the company has distinguished itself from peers by creating a great place to work for all. Not only do the majority of their employees experience the company as a great place to work, but this experience is consistent across the organization. Results from the survey are highly reliable, having a 95% confidence level and a margin of error of 5% or less.', '', '', '2017-01-18 16:46:53', '0000-00-00 00:00:00', 'Active');
